import { Fragment } from "react";

import style from "./InputRadio.module.css";

function InputRadio(props) {
  return (
    <Fragment>
      <div
        className={
          props.classContainer
            ? `${props.classContainer} ${style["radio__container"]}`
            : `${style["radio__container"]}`
        }
      >
        <input
          onChange={props.OnRadioHandler}
          type="radio"
          id={props.id}
          name={props.name}
          value={props.value}
          className={
            props.classInput
              ? `${props.classInput} ${style.input}`
              : `${style.input}`
          }
        />
        <div
          className={
            props.classCheck
              ? `${props.classCheck} ${style.check}`
              : `${style.check}`
          }
        >
          <div
            className={
              props.classInside
                ? `${props.classInside} ${style.inside}`
                : `${style.inside}`
            }
          ></div>
        </div>

        <label className={props.classLabel} htmlFor={props.id}>
          {props.label}
        </label>
      </div>
    </Fragment>
  );
}

export default InputRadio;
